INSERT INTO `admin_about_us_pages` VALUES (4,'<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Шановні власники вантажів!</span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Ринок товарообігу з кожним роком постійно зростає. Якщо раніше використовувалися тільки внутрішні перевезення вантажів на малих транспортних засобах, то сьогодні важко уявити собі ринкові відносини без міжнародних перевезень.</span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Дозвольте запропонувати Вам послуги з вантажних перевезень на території України та Європи. В нашої фірми є багаторічний досвід у сфері міжнародних перевезень та експедиційних послуг.</span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">На сьогоднішній день ми орієнтовані на Східну Європу, переважно в напрямку Словаччина - Україна а також країни СНД.</span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Послуги вантажних перевезень здійснюємо при наявності широкого автопарку відповідного європейським вимогам Євро 3 &ndash; 5.</span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Існує можливість GPS відстеження і CMR страхування.</span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Цінова політика наших послуг залежить від вантажних обсягів , ваги і умов доставки.</span></span></strong></p>\r\n','ua','2014-01-12 14:26:47','2014-01-12 14:33:21'),(5,'<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">V&aacute;žen&iacute; majitelia n&aacute;kladu!</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Obrat na trhu každ&yacute; rok rastie . Predt&yacute;m použ&iacute;van&yacute; len pre intern&uacute; prepravu tovaru v mal&yacute;ch vozidiel , je ťažk&eacute; si predstaviť trhov&eacute; hospod&aacute;rstvo s medzin&aacute;rodnou prev&aacute;dzkou .</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Pon&uacute;kame V&aacute;m služby prepravy na Ukrajine a v Eur&oacute;pe . Pretože na&scaron;a spoločnosť m&aacute; dlhoročn&eacute; sk&uacute;senosti v medzin&aacute;rodn&yacute;ch dopravn&yacute;ch a &scaron;pedičn&yacute;ch služieb .</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Dnes sme sa zamerali na v&yacute;chodnej Eur&oacute;py , predov&scaron;etk&yacute;m na Slovensko - Ukrajina a SNS .</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">N&aacute;kladn&aacute; doprava je vykon&aacute;van&aacute; na obrovsk&eacute; flotily pr&iacute;slu&scaron;n&yacute;ch eur&oacute;pskych požiadaviek Euro 3 - 5.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Je možn&eacute; , GPS tracking a CMR poistenie .</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Cenov&aacute; politika na&scaron;ich služieb z&aacute;vis&iacute; od objemu n&aacute;kladu , hmotnosti a dodac&iacute;ch podmienok .</span></span></p>\r\n','sk','2014-01-12 14:31:33','2014-01-12 14:35:07'),(6,'<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Dear owners of the cargo!</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Market turnover every year is growing. Previously used only for internal transportation of goods in small vehicles , it is difficult to imagine a market economy with international traffic.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>We offer you the services of transportation in Ukraine and Europe. As our company have many years experience in international transportation and forwarding services .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Today we focused on Eastern Europe, mainly towards Slovakia - Ukraine and CIS countries.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Freight transportation is carried out at the vast fleet of relevant European requirements Euro 3 - 5.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>It is possible GPS tracking and CMR insurance.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>The price policy of our services depends on the cargo volume , weight and delivery terms.</strong></span></span></p>\r\n','en','2014-01-12 14:34:36','2014-01-12 14:34:36'),(7,'<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Sehr geehrter Eigent&uuml;mer der Fracht!</span></span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Marktumsatz jedes Jahr w&auml;chst. Bisher nur f&uuml;r den internen Transport von Waren in kleinen Fahrzeugen verwendet wird, ist es schwierig, eine Marktwirtschaft mit internationalen Verkehr vorstellen .</span></span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Wir bieten Ihnen die Dienstleistungen der Transport in die Ukraine und Europa. Da unser Unternehmen verf&uuml;gen &uuml;ber langj&auml;hrige Erfahrung im internationalen Transport-und Speditionsdienstleistungen .</span></span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Heute haben wir uns auf Osteuropa , vor allem in Richtung Slowakei - Ukraine und GUS-Staaten.</span></span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">5 - Der G&uuml;terverkehr wird bei der gro&szlig;en Flotte von einschl&auml;gigen europ&auml;ischen Vorgaben Euro 3 durchgef&uuml;hrt.</span></span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Es ist m&ouml;glich, GPS-Tracking und CMR -Versicherung.</span></span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\">Die Preispolitik unserer Dienstleistungen h&auml;ngt von den Frachtvolumen , Gewicht und Lieferbedingungen.</span></span></strong></p>\r\n','de','2014-01-12 14:35:58','2014-01-12 14:36:23'),(8,'<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>Уважаемые владельцы грузов!</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>Рынок товарооборота с каждым годом постоянно растёт. Если раньше использовались только внутренние перевозки грузов на малых транспортных средствах, то сегодня трудно представить себе рыночные отношения без международных перевозок .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>Позвольте предложить Вам услуги по грузовым перевозкам на территории Украины и Европы. В нашей фирмы есть многолетний опыт в сфере международных перевозок и экспедиционных услуг.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>На сегодняшний день мы ориентированы на Восточную Европу , преимущественно в направлении Словакия - Украина а также страны СНГ.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>Услуги грузовых перевозок осуществляем при наличии широкого автопарка соответствующего европейским требованиям Евро 3 - 5.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>Существует возможность GPS отслеживания и CMR страхование .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:16px\"><strong>Ценовая политика наших услуг зависит от грузовых объемов , веса и условий доставки.</strong></span></span></p>\r\n','ru','2014-01-12 14:38:03','2014-01-12 14:38:03'),(9,'<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">V&aacute;žen&iacute; majitel&eacute; n&aacute;kladu!</span></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Obrat na trhu každ&yacute; rok roste . Dř&iacute;ve použ&iacute;v&aacute;n pouze pro intern&iacute; přepravu zbož&iacute; v mal&yacute;ch vozidel , je těžk&eacute; si představit tržn&iacute; hospod&aacute;řstv&iacute; s mezin&aacute;rodn&iacute;m provozem .</span></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Nab&iacute;z&iacute;me V&aacute;m služby přepravy na Ukrajině a v Evropě . Protože na&scaron;e společnost m&aacute; dlouholet&eacute; zku&scaron;enosti v mezin&aacute;rodn&iacute;ch dopravn&iacute;ch a spedičn&iacute;ch služeb .</span></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Dnes jsme se zaměřili na v&yacute;chodn&iacute; Evropy , předev&scaron;&iacute;m na Slovensko - Ukrajina a SNS .</span></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">N&aacute;kladn&iacute; doprava je prov&aacute;děna na obrovsk&eacute; flotily př&iacute;slu&scaron;n&yacute;ch evropsk&yacute;ch požadavků Euro 3 - 5 .</span></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Je možn&eacute;, GPS tracking a CMR poji&scaron;těn&iacute; .</span></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><strong><span style=\"font-family:arial,helvetica,sans-serif\">Cenov&aacute; politika na&scaron;ich služeb z&aacute;vis&iacute; na objemu n&aacute;kladu , hmotnosti a dodac&iacute;ch podm&iacute;nek .</span></strong></span></p>\r\n','cz','2014-01-12 14:39:14','2014-01-12 14:39:14'),(10,'<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Drodzy właściciele ładunk&oacute;w!</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Każdego roku obroty na rynku rośnie . Poprzednio używane tylko do wewnętrznego transportu towar&oacute;w w małych samochodach , trudno jest wyobrazić sobie, gospodarki rynkowej z ruchu międzynarodowego .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Oferujemy Państwu usługi w zakresie transportu na Ukrainie iw Europie . Ponieważ nasza firma ma wieloletnie doświadczenie w międzynarodowych usługach transportowych i spedycyjnych .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Dziś skupia się na Europie Wschodniej , gł&oacute;wnie w kierunku Słowacja - Ukraina i WNP krajach .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Transport ładunk&oacute;w odbywa się w ogromnej floty odpowiednich wymagań europejskich Euro 3 - 5 .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Możliwe jest śledzenie GPS i ubezpieczenia CMR .</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Polityka cen naszych usług zależy od względem ilości ładunku, masy i dostawczych .</strong></span></span></p>\r\n','pl','2014-01-12 14:40:02','2014-01-12 14:40:02');
